<p>离开需求和使用场景谈效率工具都是耍流氓，一个工具、一个系统再强大，也要看看是否满足你的使用场景。</p>
<p><strong>写作目标：</strong></p>
<ul>
<li>初步了解这个软件</li>
<li>Obsidian 有趣的玩法</li>
</ul>
